import Content from "../contents/Content";
import Nav from "../navbar/Nav";
import "./Order.css";
function Order() {
  return (
    <>
      <Nav />
      <div className="ordercardmain1">
        <div className="ordercardmain01">
          <p className="ordermore">more</p>
          <div className="ordercardmain2">
            <div className="ordernum">
              <p className="orderheadname2">{props.index.id}</p>
            </div>

            <div className="ordercardmain3">
              <p className="orderheadname">{props.index.name}</p>
              <div className="ordersubcard1">
                {props.index.names.map((index) => {
                  if (i < 3) {
                    return (
                      <div className="ordercontentCard">
                        <img className="orderimgs" src={props.index.imgs[i]} />
                        {console.log(i)}
                        <p className="ordercardhead">{props.index.names[i]}</p>
                        <p className="ordercardcap">
                          {props.index.captions[i]}
                        </p>
                        <p className="hidden">{(i = i + 1)}</p>
                      </div>
                    );
                  }
                })}
              </div>
            </div>
          </div>
        </div>
      </div>
      <Content notindex={-1} />
    </>
  );
}
export default Order;
